import React from 'react';
import './Home.css'
import { Link } from 'react-router-dom'
import { Container, Card } from 'semantic-ui-react'
import { DB } from '../file/DB.json'

function Home() {
  return (
    <Container className='home' onDragStart={event => event.preventDefault()}>
      <Card.Group itemsPerRow={2}>
        {Object.keys(DB).map(id => (
          <Link to={{
            pathname: `/view/${id}`
          }} key={id}>
            <Card>
              <Card.Content></Card.Content>
            </Card>
          </Link>
        ))}
      </Card.Group>
    </Container>
  );
}

export default Home;
